def compare_rest(rest, hit):
    try:
        rest_local = rest.split('@')[0]
        hit_local = hit.split('@')[0]
        if rest_local[0] == hit_local[0] and rest_local[-1] == hit_local[-1]:
            return True
        else:
            return False
    except:
        return False


